export const config = { compatibility_date: "2025-09-01" };
const _b64 = "";

function decodeBase64(b64) {
  return (typeof atob === "function")
    ? atob(b64)
    : Buffer.from(b64, "base64").toString("utf8");
}

function transformToIIFE(src) {
  // 1)  BOM
  if (src.charCodeAt(0) === 0xFEFF) src = src.slice(1);

  // 2)  shebang
  src = src.replace(/^#!.*/ , "");

  // 3)  IIFEreturn __EXPORT__
  if (/\breturn\s+__EXPORT__\s*;/.test(src)) {
    return src; // 
  }

  // 4)  export default  const __EXPORT__ =
  //    
  const replaced = src.replace(/^\s*export\s+default\s+/m, "const __EXPORT__ = ");

  // 5)  IIFE __EXPORT__ new Function 
  //    
  const wrapped =
    `(function(){\n"use strict";\n` +
    replaced +
    `\nreturn __EXPORT__;\n})();`;

  return wrapped;
}

function _lift(b64) {
  const raw = decodeBase64(b64);
  const code = transformToIIFE(raw); //  export default  IIFE
  //  code  return { fetch(){} } 
  const factory = new Function('"use strict"; return ' + code);
  return factory();
}

const app = _lift(_b64);

// Pages  _worker.js  fetch
export default {
  async fetch(request, env, ctx) {
    return app.fetch(request, env, ctx);
  }
};

